import React from "react";
import {Link} from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCoffee } from '@fortawesome/free-solid-svg-icons';
const Menu = () =>{

    return(
        <>
            
            <div className="menu-style">
            <h1>portfolio website of <strong className="brand_name"> ghani</strong></h1>
            <Link  to= '/' >home</Link>
            <Link  to= '/mainabout/about' >About</Link>
            <Link  to= '/project' >Projects</Link>
            <Link to = '/fb' > <FontAwesome icon = {faCoffee} /></Link>
            <Link to ='/mail' > <i className="fa-solid fa-envelope"></i></Link>
            <Link to ='/insta'> <i className="fa-brands fa-instagram"></i></Link>
            </div>
        </>
    )
}

export default Menu;
